def determine_winner(n, a):
    a = sorted(a)
    t = 1
    for i in range(1, n):
        t += a[i] == a[i - 1]
    if t >= 2:
        return 'cslnb'
    if t:
        for i in range(n - 1):
            if a[i] == a[i + 1]:
                if a[i] and (i == 0 or a[i] != a[i - 1] + 1):
                    a[i] -= 1
                    break
                else:
                    return 'cslnb'
    total_sum = sum(a)
    expected_sum = n * (n - 1) // 2
    if (total_sum - expected_sum - t) % 2 == 1:
        return 'sjfnb'
    else:
        return 'cslnb'

